$Util.clone = function(obj) {
    var o;
    if (typeof obj == "object") {
        if (obj === null) {
            o = null;
        } else {
            if (obj instanceof Array) {
                o = [];
                for (var i = 0, len = obj.length; i < len; i++) {
                    o.push($Util.clone(obj[i]));
                }
            } else {
                o = {};
                for (var j in obj) {
                    if(typeof(o[j]) == 'function' || j == '_alarmState'){
                        continue;
                    }
                    o[j] = $Util.clone(obj[j]);
                }
            }
        }
    } else {
        o = obj;
    }
    return o;
};

