        if (this._renderCallbacks.indexOf(renderCallback) >= 0) { //
            return;
        }
        if (renderCallback.onRenderCallback) {
            if (index === undefined) {
                return this._renderCallbacks.push(renderCallback);
            } else {
                return this._renderCallbacks.splice(index, 0, renderCallback);
            }
        }
