        var newTarget=clickObj.point;
        var offset=camera.getPosition().sub(camera.getTarget());
        var f_position=new mono.Vec3().addVectors(offset, newTarget);
        it.Util.playCameraAnimation(camera,f_position,newTarget,1000);
