			var oldDistance = camera.getDistance();
			var distance = fBb.size().z > fBb.size().x ? fBb.size().x : fBb.size().z;
			distance = distance * 2;
			var angles = mono.Utils.getVectorAngles(camera.target, camera.getPosition());
