        width -= (xPadding[0] + xPadding[1]);
        height -= (yPadding[0] + yPadding[1]);
        depth -= (zPadding[0] + zPadding[1]);
       
        var emptyList = space.getEmptyList();
        var nodes = [],i = 0,object,percent = space.getPercent();
