    setParent: function(parent) {
        this.parent = parent;
    },

    addChildren: function(datas) {
        if (!datas || datas.length < 1) {
            return;
        }
        for (var i = 0; i < datas.length; i++) {
            var data = datas[i];
            this.addChild(data);
        }
    },

