	 	var oldLevel = this.dataPowerMap[dataId];
	 	delete this.dataPowerMap[dataId];
	 	this._dRMManagerChangeDispatcher.fire({
			kind: 'remove',
			dataId: dataId,
			oldLevel: oldLevel
		});
